MongoDB: How to create an object that has an array of objects as a field?<p>I have this schema:</p>
<pre><code>const SingleExerciseSchema = new Schema({
    exerciseName: { type: String },
    setLog: [{
        weight: { type: Number },
        sets: { type: Number },
        reps: { type: Number },
    }],
});
</code></pre>
<p>Then I get data like this, as a json:</p>
<pre><code>const DATA = [
    { exerciseName: &quot;Squat&quot;,
      setLog: [
        {weight: 65, sets: 1, reps: 5},
        {weight: 55, sets: 2, reps: 5},
        {weight: 45, sets: 1, reps: 5},
      ]
    },
    { exerciseName: &quot;Overhead Press&quot;,
      setLog: [
        {weight: 27.5, sets: 1, reps: 5}
      ]
    }
  ];
</code></pre>
<p>I want to loop over the data and create my SingleExercise objects from it.</p>
<p>Like this:</p>
<pre><code>const exerciseObjectList = (req.body).map(
    (exerciseLog) =&gt; new SingleExercise({
      exerciseName: req.body.exerciseName,
      setLog: // stuck here
    })
</code></pre>
<p>However, I'm not sure to update/access the setLog fields, syntax wise. I want something like this:</p>
<pre><code>const exerciseObjectList = (req.body).map(
    (exerciseLog) =&gt; new SingleExercise({
      exerciseName: req.body.exerciseName,
      setLog: {
        (req.body.setLog).map(
          (set) =&gt; {
            weight: set.weight,
            sets: set.sets,
            reps: set.reps,
          }
        )
      }
    })
  );
</code></pre>
<p>but it's obviously wrong syntax.</p>
<p>Edit: I actually had a stupid mistake in my code, I wrote req.body.exerciseName instead of exerciseLog.exerciseName in my loop.
Also, I just went with</p>
<pre><code>setLog: exerciseLog.setLog
</code></pre>
<p>and it works (instead of accessing each field inside setLog separately).
I still don't know how to access each field separately, but for now, I don't need to do that.</p>
<p>Fixed code:</p>
<pre><code>const exerciseObjectList = (req.body).map(
    (exerciseLog) =&gt; new SingleExercise({
      exerciseName: exerciseLog.exerciseName,
      setLog: exerciseLog.setLog,
    }));
</code></pre>

