Unable to Connect to MongoDB using Node.js MongoClient<p>I'm facing an issue while trying to connect to MongoDB from my Node.js application using the mongodb driver.</p>
<p>I have a MongoDB server running on my local machine, and I can successfully connect to it using MongoDB Compass and the VS Code extension.</p>
<p>However, when I attempt to connect from my Node.js application, I encounter an error.</p>
<pre class="lang-js prettyprint-override"><code>const { MongoClient } = require('mongodb');

const uri = 'mongodb://localhost:27017/';
const client = new MongoClient(uri);

client.connect((err) =&gt; {
  if (err) {
    console.error(err);
    return;
  }
  console.log('Connected to MongoDB');

  // ... continue with my code
});
</code></pre>
<p>The error message I receive is:</p>
<pre><code>MongoServerSelectionError: connect ECONNREFUSED ::1:27017
  // rest of the error details...
</code></pre>
<p>I was try to connect to MongoDB from a Node.js app.</p>
<p>I have already checked the following:</p>
<ul>
<li>The MongoDB server is running on my local machine, and I can connect using MongoDB Compass and VS Code extension.</li>
<li>I have installed the mongodb package using npm, and I tried different versions of the package as well.</li>
<li>There is no authentication required to connect to my MongoDB server.</li>
<li>I have also tried specifying the version of the mongodb package during installation, but the issue persists.</li>
</ul>
<p>Why I can't connect to MongoDB from my Node.js application? Am I missing something in my code or configuration?</p>

