<p>I've an async function which updates a document.
I'm running that function 10 times with different parameter in parallel.
My question is that will mongoose/mongodb auto fetch the document again before saving if it's already saved before. Or will it throw an error?</p>
<p>Here's my code</p>
<pre><code>const crawlSitemap = async (projectId) =&gt; {
  try {
    const project = await Project.findById(projectId);
    const browser = await puppeteer.launch({ headless: &quot;new&quot; });

    const crawl = (sitemap) =&gt; async () =&gt; {
      const page = await browser.newPage();
      page.setDefaultNavigationTimeout(120 * 1000);
      console.log(sitemap.url);
      if (!validator.isURL(sitemap.url) || sitemap.crawlStatus !== &quot;queued&quot;)
        return;
      await page.goto(sitemap.url, { waitUntil: &quot;networkidle0&quot; });
      await page.evaluate(() =&gt; {
        const scripts = document.querySelectorAll(&quot;script&quot;);
        scripts.forEach((script) =&gt; script.remove());

        const images = document.querySelectorAll(&quot;img&quot;);
        images.forEach((img) =&gt; img.remove());

        const styles = document.querySelectorAll(
          'link[rel=&quot;stylesheet&quot;], style'
        );
        styles.forEach((style) =&gt; style.remove());
      });
      const textContent = await page.evaluate(() =&gt; document.body.textContent);
      await page.close();

      await promisify(fs.writeFile)(
        path.join(__dirname, `tmp/${sitemap.url.replaceAll(&quot;/&quot;, &quot;-&quot;)}.txt`),
        textContent,
        &quot;utf-8&quot;
      );
      sitemap.crawlStatus = &quot;ok&quot;;
      await project.save();
    };

    await parallelLimit(project.sitemap.map(crawl), 10);

    await browser.close();
  } catch (error) {
    console.log(error);
  }
};

</code></pre>

