Mongo linking one array to another<p>The starting point for this query is a collection called books:</p>
<pre><code>{
   '_id' {&quot;$oid&quot;: &quot;64ba6a416504f1f01d773faa&quot;},
   'isbn': 8765434567890,
   'booktitle': 'some text',
   'chapters':
      [
         {
            'r_id': {&quot;$oid&quot;: &quot;64ba6a416504f1f01kkk333&quot;},
            'pagenr': 7,
            'title': 'whatever',
         },
         {
            'r_id': {&quot;$oid&quot;: &quot;64ba6a416504f1f01dj3jd7f&quot;},
            'pagenr': 12,
            'title': 'another title',
         },
      ]
}
</code></pre>
<p>There's of course much more to it. But this collection is the starting point for the query.</p>
<p>A second collection has notes about a lot of things in various collections, amongst others about the chapters in the above collection:</p>
<pre><code>{
   '_id' {&quot;$oid&quot;: &quot;64ba6a416504f1f01d773faa&quot;},
   'r_id': {&quot;$oid&quot;: &quot;64ba6a416504f1f01kkk333&quot;},
   'note': 'blabla',
},
{
   '_id' {&quot;$oid&quot;: &quot;64ba6a416504f1f01d888hhh&quot;},
   'r_id': {&quot;$oid&quot;: &quot;64ba6a416504f1f01kkk333&quot;},
   'note': 'more blabla',
},
{
   '_id' {&quot;$oid&quot;: &quot;55353536504f1f01d000000&quot;},
   'r_id': {&quot;$oid&quot;: &quot;64ba6a416swldkjfdskjl34&quot;},
   'note': 'blabla',
},
</code></pre>
<p>So more notes can be about the same chapter. Linked by the <strong>r_id</strong> oid in both collecions.</p>
<p>What I need is two almost similar things:</p>
<p><strong>1</strong> Get the complete record of one book by the <strong>isbn</strong> nr.
And add the <strong>amount of notes per chapter</strong> to that record.</p>
<p><strong>2</strong> Get the complete record of one book by the <strong>isbn</strong> nr.
And add <strong>all of the notes per chapter</strong> to that record.</p>
<p><strong>NB</strong> The chapters are not ordered in the collection, but should be ordered by chapters.pagenr in the output.</p>
<p>So the output for <strong>1</strong> would be something like:</p>
<pre><code>{
   '_id' {&quot;$oid&quot;: &quot;64ba6a416504f1f01d773faa&quot;},
   'isbn': 8765434567890,
   'booktitle': 'some text',
   'chapters':
      [
         {
            'r_id': {&quot;$oid&quot;: &quot;64ba6a416504f1f01kkk333&quot;},
            'pagenr': 7,
            'title': 'whatever',
            'notes': 2
         },
         {
            'r_id': {&quot;$oid&quot;: &quot;64ba6a416504f1f01dj3jd7f&quot;},
            'pagenr': 12,
            'title': 'another title',
            'notes': 0
         },
      ]
}
</code></pre>
<p>For <strong>2</strong> notes would of course contain the array of notes. Almost the same, but not.</p>
<p>What I've come up with so far:</p>
<pre><code>match = {'$match': {'isbn': {'$in': isbns}}}
project = {'$project':
        {
            '_id': '$_id',
            'isbn': '$isbn',
            'booktitle': '$booktitle',
            'chapters': {'$sortArray':
                {
                    'input': {'$map':
                                  {'input':
                                       '$chapters',
                                   'in': {
                                       'pagenr': '$$this.pagenr',
                                       'title': '$$this.title',
                                       'r_id': '$$this.r_id',
                                       }
                                   }
                              },
                    'sortBy': {'pagenr': 1},
                }
            },
            'notes': '$$related_notes',

      }
}
lookup = {'$lookup':
        {
            'from': 'notes',
            'localField': 'chapters.r_id',
            'foreignField': 'r_id',
            'as': 'related_notes',
        },
}

pipeline = [
        lookup,
        match,
        project,
    ]
</code></pre>
<p>This works, the notes are of course added to the end of the output. If I put them in the $map part, they are repeated numerous times and not filtered in any way.</p>
<p>By the way, coming from SQL, I really love Mongo. It's marvelous however not easy to grasp. Learning a lot about it.</p>
<p>Thanks for the help.</p>

